import React from 'react';
import '../../App.css';
import Dashboard from '../Dashbar';
import DashboardNavbar from './DashboardNavbar';

function Login() {
    return (
        <>
            <DashboardNavbar />
            <Dashboard />
        </>
    );
}

export default Login;
